import "./Logo.css";
import React from "react";
import logoImage from "../images/logo.png";
import darkLogoImage from "../images/LOGO-DARK.png";
import { useTheme } from "../ThemeContext";

function Logo() {
  const { theme } = useTheme();

  return (
    // <div className="d-flex justify-content-center">
    //   <img src={logoImage} alt="Logo" className={`img-fluid ${theme === 'dark' ? 'dark' : ''}`} />
    // </div>

    <div className="d-flex justify-content-center">
       <div className={`img-fluid ${theme === 'dark' ? 'dark' : ''}`}>
      {/* Conditional rendering for logo based on the theme */}
      {theme === 'light' ? (
        <img src={logoImage} alt="Light Logo" className="logo" />
      ) : (
        <img src={darkLogoImage} alt="Dark Logo" className="logo" />
      )}
      </div>
    </div>
  );
}

export default Logo;
